import React from "react";
import SideImage from "./Components/SideImageArea/SideImage";
import Forms from "./Components/Forms/Forms";
const Login = () => {
  return (
    <div style={{ display: "flex", minHeight: "100vh" }}>
      <div
        style={{
          width: "40%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <div>
          <SideImage />
        </div>
      
      </div>

    </div>
  );
};

export default Login;
